import React, {useState, useContext, useEffect} from 'react'
// import { DinerContext } from '../../Contexts/DinerContext'
import axiosWithAuth from '../axiosWithAuth'



export default function OperatorTrucks({match}) {
    const [item, setItem] = useState([]);
    console.log(item)
    // const [operatorTrucks] = useContext(DinerContext)
    console.log(match)
    // console.log(operatorTrucks)
    useEffect(()=>{
        axiosWithAuth().get(`/api/ops/${match.params.id}`)
        .then(res =>{
            console.log(res.data.data)
            setItem(res.data.data)
        })
        .catch(err =>{
            console.log(err, 'No data Coming in!')
        })

    },[])


    return (
        <div>
            <h1>Welcome: {item.username}</h1>
            <h2>Click Here: To add a truck</h2>
        </div>
    )
}
